INSERT INTO `event` VALUES (1,'Putra & Putri','THE WEDDING OFF','2023-12-12','77226355','https://hi.diamengundang.com/diamond-01/','baner.jpg',0,'Tes NAMA : [NAMA-TAMU]\r\nLINK : [LINK]\r\nDOWNLOAD QR : [E-INVITATION]',6,'3786',0,1,0),(3,'Tiara & Aji','The Wedding of','2024-12-28','','https://hi.diamengundang.com/diamond-01/','917c8d2ce62ab1c3943c5df9a551442b.jpg',0,'Bismillahirrahmanirrahim,\r\nAssalamualaikum warahmatullahi wabarakatuh,\r\n\r\nKepada Yth Bapak/Ibu/Saudara/i :  \r\n*[NAMA-TAMU]*\r\n\r\nTanpa mengurangi rasa hormat, kami mengundang Bapak/Ibu/Saudara/i untuk dapat menghadiri acara bahagia kami, untuk selengkapnya dimohon untuk buka Link Undangan berikut ini :\r\n\r\n[LINK]\r\n\r\nMerupakan suatu kehormatan dan kebahagiaan bagi kami apabila Bapak/Ibu/Saudara/i berkenan untuk hadir dan memberikan doa restu kepada kami.\r\n\r\nMohon untuk download QR Code dan tunjukkan saat memasuki Gedung Resepsi.\r\n[E-INVITATION]',6,'3786',1,0,0),(4,'Putri & Ridho','The Wedding Of Putri & Ridho','2024-05-09','','https://zehan-invitation.com/putri-ridho/','baner.jpg',0,'Kepada Yth. [NAMA-TAMU]\n\nTanpa mengurangi rasa hormat, perkenankan kami mengundang Bapak/Ibu/Saudara/i, teman sekaligus sahabat, untuk menghadiri acara pernikahan putra-putri kami :\n\n* & *\n\nBerikut link undangan kami untuk info lengkap dari acara bisa kunjungi : \n\n[LINK]\n\nMerupakan Suatu Kehormatan dan kebahagiaan bagi kami apabila Bapak/Ibu/Saudara/i berkenan hadir dan memberikan doa restu di acara pernikahan putra-putri kami. \n\nAtas perhatiannya kami ucapkan terimakasih.\nSpesial Invited by Ruang Invitation',7,'74491',0,0,0);
